import React,{Component} from 'react';
import { Image } from 'react-bootstrap';
class Home extends Component{
    render(){
        return(
            <React.Fragment>
                <div className="navigationdiv">
                    <center>
                        <h2>Online Quiz Portal</h2>
                    </center>
                </div>
                {/* <Image src="./navigation.jpg" fluid /> */}
            </React.Fragment>
        );
    }
}

export default Home;
